import React from "react";
import "./Home.css";
import Main from "./Main";
import Review from "./Review";
import Mapper from "./Mapper";
import Backpack from "./Backpack";
import Ask from "./Ask";

const home = (props) => (
  <div style={{ textAlign: "center" }}>
    <Main />
    <h2 className="divider">Our Motivation</h2>
    <h2 className="divider">I</h2>
    <Review />
    <h2 className="divider">II</h2>
    <Mapper />
    <h2 className="divider">III</h2>
    <Backpack />
    <h2 className="divider">IV</h2>
    <Ask />
  </div>
);

export default home;
